import React from "react";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import { Line } from "react-chartjs-2";
import faker from "faker";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

export const options = {
  responsive: true,
  plugins: {
    legend: {
      position: "top",
    },
    title: {
      display: true,
      // text: "Hourly forecast",
    },
  },
};

function Chart({newXAxisData, newYAxisData, dataa}) {
  const labels = newXAxisData;
  console.log("new x data ===",newXAxisData)
  console.log("new y data===",newYAxisData)
  const data = {
    labels,
    datasets: [
      {
        label: "Temperature",
        data: newYAxisData,
        borderColor: "#eb6e4b",
        backgroundColor: "#eb6e4b",
      },
    ],
  };
  return (
    <div className="hourly_chart">
      <h3>Hourly forecast</h3>
      <Line options={options} data={data} className="line__chart" />
    </div>
  );
}

export default Chart;
